		[4] = { 0.10000000149012, 1.8999999761581, PvPDamageMultiplier = -40, critChance = 5, damageEffectiveness = 0.6, levelRequirement = 37, statInterpolation = { 3, 3, }, cost = { Mana = 15, }, },
